CREATE SCHEMA Bibliothek;

SET search_path TO Bibliothek;

DROP TABLE IF EXISTS autor CASCADE;

CREATE TABLE autor (
    autorid integer NOT NULL PRIMARY KEY,
    nachname varchar(30) NOT NULL,
    zusatz varchar(10),
    vornamen varchar(30)
);

DROP TABLE IF EXISTS verlag CASCADE;

CREATE TABLE verlag (
    verlagsid integer NOT NULL PRIMARY KEY,
    name varchar(80) NOT NULL,
    ort varchar(1000)
);

DROP TABLE IF EXISTS buch CASCADE;

CREATE TABLE buch (
    buchid integer NOT NULL PRIMARY KEY,
    titel varchar(255),
    isbn varchar(15),
    auflage varchar(70),
    jahr smallint,
    preis numeric(10,2),
    waehrung varchar(15),
    signatur varchar(30),
    verlagsid integer,
	FOREIGN KEY (verlagsid) REFERENCES verlag
);

DROP TABLE IF EXISTS schlagwort CASCADE;

CREATE TABLE schlagwort (
    swid integer NOT NULL PRIMARY KEY,
    schlagwort varchar(50) NOT NULL
);

DROP TABLE IF EXISTS buch_aut CASCADE;

CREATE TABLE buch_aut (
    buchid integer NOT NULL,
    autorid integer NOT NULL,
    rolle character(1) NOT NULL,
    rang smallint, 
    PRIMARY KEY (buchid, autorid),
	FOREIGN KEY (buchid) REFERENCES buch,
	FOREIGN KEY (autorid) REFERENCES autor
 );
 
DROP TABLE IF EXISTS buch_sw CASCADE;
 
 CREATE TABLE buch_sw (
    buchid integer NOT NULL,
    swid integer NOT NULL,
	PRIMARY KEY (buchid, swid),
	FOREIGN KEY (buchid) REFERENCES buch,
	FOREIGN KEY (swid) REFERENCES schlagwort	
);













